import React from 'react';
import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

function Header() {
  return (
    <div className="bg-lime-400 h-11 flex items-center p-4">
      <h1 className="text-slate-900 font-extrabold text-4xl sm:text-2xl">Workify</h1>
    </div>
  );
}

function HomePage() {
  return (
    <div>
      <h1 className="text-slate-900 font-extrabold text-4xl sm:text5xl tracking-tight text-center dark:text-white">Welcome!</h1>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <Header></Header>

      <div className="p-4">        
        <BrowserRouter>
          <Routes>
            <Route path="/" element={<HomePage/>}></Route>
          </Routes>
        </BrowserRouter>
      </div>
    </div>
  );
}

export default App;
